import Header from './layout/Header';
import Footer from "./layout/Footer";
import Banner from "./layout/Banner";
import ScrollToTop from "./ScrollToTop";
import EmptyContent from "./EmptyContent";

export {
    Header,
    Footer,
    Banner,
    ScrollToTop,
    EmptyContent
}

export default {
    Header,
    Footer,
    Banner,
    ScrollToTop,
    EmptyContent
}
